import React, { useState, useEffect } from 'react';
import {useNavigate } from "react-router-dom";
import axios from 'axios';
import './Profile.css';
import { useUser } from './UserContext';

function Profile() {
  const navigate = useNavigate();
  const { setUserData } = useUser();
  //const [popup, setPopup] = useState({ visible: false, action: "" });
  const [history, setHistory] = useState([]);
  const [errorMessage, setErrorMessage] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');

    if (!token) {
      setErrorMessage('You need to log in to view your profile.');
      return;
    }

    axios
      .post(
        'http://localhost:8080/diagnosis-history',
        { token },
        { withCredentials: true }
      )
      .then((response) => {
        if (response.data.success) {
          setHistory(response.data.history);
        } else {
          setErrorMessage(response.data.message);
        }
      })
      .catch(() => {
        setErrorMessage('Failed to load diagnosis history.');
      });
  }, []);

  // const DeleteAccount = () => {
  //   const [showPopup, setShowPopup] = useState(false);
  
  const handleDeleteAccount = async () => {
    try {
      const token = localStorage.getItem("token");
      const response = await fetch("http://localhost:8080/delete-account", {
        method: "DELETE",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`, // Pass token in headers
        },
        body: JSON.stringify({ token: token }),
      });
  
      const data = await response.json();
      if (response.ok && data.success) {
        alert(data.message || "Account deleted successfully!");
        localStorage.clear(); // Clear user data locally
        setUserData(null);
        navigate("/"); // Redirect to homepage
      } else {
        alert(data.message || "Error deleting account.");
      }
    } catch (error) {
      console.error(error);
      alert("An unexpected error occurred.");
    }
  };
  

    
  const handleLogout = async () => {
    try {
      await axios.get('http://localhost:8080/logout',{ withCredentials: true });
      // localStorage.removeItem('loggedInUser');
      // localStorage.removeItem('token');
      localStorage.clear();
      navigate('/');
      window.location.reload();
    } catch (error) {
      console.log('Error logging out:', error);
    }
  };

  // return (
  //   <div className="profile">
  //     <div className="profile-header">
  //       <h1 className='h1'>Your Diagnosis History</h1>
  //       <p className='p'>Explore your results with rich visuals and animations.</p>
  //     </div>

  //     {errorMessage && <p className="error-message">{errorMessage}</p>}

  //     <div className="history-container">
  //       {history.length > 0 ? (
  //         history.map((item, index) => (
  //           <div className="history-row" key={index}>
  //             <div className="content">
  //               <h3 className="disease-name">{item.diseaseName}</h3>
  //               <p className="diagnosis-date">
  //                 Diagnosed on: {new Date(item.createdAt).toLocaleDateString()}
  //               </p>
  //               <img
  //                 className="disease-image"
  //                 src={item.imageUrl}
  //                 alt={item.diseaseName}
  //               />
  //             </div>
  //           </div>
  //         ))
  //       ) : (
  //         <p className="no-history">No diagnosis history found.</p>
  //       )}
  //     </div>
  //   </div>
  // );


  return (
    <div className="Profile">
      <div className="card" style={{ height: '400px', borderadius: '10px'}}>
        <div className="image"></div>
        <div className="card-info">
          <span>George Johnson</span>
          <p>Support Specialist</p>
        </div>
        <div className="button-card">
          <a href="/" className="button-edit">
            Edit Profile
          </a>
          <a href="/" className="button-delete" onClick={() => handleDeleteAccount()}>
            Delete Account
          </a>
        
          <a href="/" className="button-logout" onClick={() => {handleLogout()}}>
            Logout
          </a>
        </div>
      </div>
      <div className="info">
      <div className="info">
  <div className="info-card">
  {errorMessage && <p className="error-message">{errorMessage}</p>}
    <h2>Upload History</h2>
    {/* <ul>
      <li>
        <span>Document 1</span>
        <span className="upload-date">2024-12-01</span>
      </li>
      <li>
        <span>Image 2</span>
        <span className="upload-date">2024-12-01</span>
      </li>
      <li>
        <span>PDF Report</span>
        <span className="upload-date">2024-11-30</span>
      </li>
    </ul> */}
    {history.length > 0 ? (
          history.map((item, index) => (
            <div className="history-row" key={index}>
              <div className="content">
                <img
                  className="disease-image"
                  src={item.imageUrl}
                  alt={item.diseaseName}
                />
              </div>
              <div>
              <h3 className="disease-name">{item.diseaseName}</h3>
                <p className="diagnosis-date">
                  Diagnosed on: {new Date(item.createdAt).toLocaleDateString()}
                </p>
              </div>
            </div>
          ))
        ) : (
          <p className="no-history">No diagnosis history found.</p>
        )}
  </div>
  </div>
      </div>
    </div>
  );
  
}

export default Profile;
